import "./cliente.css";
import FormDialog from "../dialog/dialog";
import { React, useState } from "react";
import Axios from "axios";

export default function Cliente(props) {
  const [open, setOpen] = React.useState(false);
  const [editValues, setEditValues] = useState({
    nome: props.nome,
    email: props.email,
    telefone: props.telefone,
  });

  const handleDeleteButton = () => {
    Axios.delete(`http://localhost:3001/deletar/${editValues.id}`).then(() => {
      props.setListCliente(
        props.listCliente.filter((value) => {
          return value.id !== editValues.id;
        })
      );
    });
  };

  return (
    <>
      <FormDialog
        open={open}
        setOpen={setOpen}
        nome={props.nome}
        email={props.email}
        telefone={props.telefone}
        listCliente={props.listCliente}
        setListCliente={props.setListCliente}
        id={props.id}
      />
      <div className="conteudo-lista-cliente" onClick={() => setOpen(true)}>
        <p>{props.nome}</p>
        <p>{props.email}</p>
        <p>{props.telefone}</p>
        <button onClick={() => handleDeleteButton()}>Excluir</button>
      </div>
    </>
  );
}
